import React, { Component } from "react";
import {
  View,
  Text,
  TouchableOpacity,
  Image,
  Modal,
  StyleSheet,
} from "react-native";
import { FontAwesome5 } from "@expo/vector-icons";

export default class Dashboard extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <View style={{ flex: 1 }}>
        <View>
          <TouchableOpacity
            onPress={() => {
              this.props.navigation.openDrawer();
            }}
            style={{ marginTop: 30, marginLeft: 20 }}
          >
            <FontAwesome5 name="bars" size={24} color="#000000"></FontAwesome5>
          </TouchableOpacity>
        </View>

        <View style={styles.container}>
          <Text style={{ fontWeight: "bold", fontSize: 32, color: "#0E6655" }}>
            DASHBOARD
          </Text>
          <View>
            <TouchableOpacity
              onPress={() => {
                this.props.navigation.navigate("AnimalView");
              }}
            >
              <Text
                style={{
                  fontWeight: "bold",
                  fontSize: 20,
                  color: "#2C3E50",
                  paddingTop: 10,
                }}
              >
                My Animals
              </Text>
            </TouchableOpacity>
          </View>
          {/* comment */}
          <View>
            <TouchableOpacity>
              <Text
                style={{
                  fontWeight: "bold",
                  fontSize: 20,
                  color: "#D35400",
                  paddingTop: 10,
                }}
              >
                My Farm Tasks
              </Text>
            </TouchableOpacity>
          </View>
          {/* comment */}
          <View>
            <TouchableOpacity>
              <Text
                style={{
                  fontWeight: "bold",
                  fontSize: 20,
                  color: "#2E86C1",
                  paddingTop: 10,
                }}
              >
                Land and Crop Manager
              </Text>
            </TouchableOpacity>
          </View>
          {/* comment */}
          <View>
            <TouchableOpacity
              onPress={() => {
                this.props.navigation.navigate("PurchasesDrawer");
              }}
            >
              <Text
                style={{
                  fontWeight: "bold",
                  fontSize: 20,
                  color: "#E74C3C",
                  paddingTop: 10,
                }}
              >
                Spray / Fertilizer / Feed
              </Text>
            </TouchableOpacity>
          </View>
        </View>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
  },
  button: {
    backgroundColor: "white",
    height: 70,
    marginHorizontal: 20,
    borderRadius: 35,
    alignItems: "center",
    justifyContent: "center",
    marginVertical: 5,
    shadowColor: "#000",
    shadowOffset: {
      width: 0,
      height: 7,
    },
    shadowOpacity: 0.41,
    shadowRadius: 9.11,

    elevation: 14,
  },
});
